import React from 'react';
import '../../global_css/containers.scss';
import appStoreImg from '../../assets/app-store.png';
import googlePlayImg from '../../assets/google-play.png';

const altMensage = "it wasn't possible to load this image";

const Or = ({className}) => {
  return (
    <div className={`or-and-line-container ${className}`}>
      <div className="line"/>
      <span>OR</span>
      <div className="line"/>
    </div>
  )
}

Or.defaultProps = { className:"" }


const GetTheApp = ({className}) => {
  return (
    <div className="get-the-app-container">
      <div className="text-align-center">Get the app.</div>
      <div>
        <img src={appStoreImg} alt={altMensage}/>
        <img src={googlePlayImg} alt={altMensage}/>
      </div>
    </div>
  )
}

GetTheApp.defaultProps = { className:"" }

export {Or, GetTheApp};
